import 'bootstrap/dist/css/bootstrap.min.css';

import React, {Component} from 'react';
import {Route, HashRouter, Redirect} from "react-router-dom";
import HomePage from "./homePackage/HomePage";
import LoginScreen from "./loginPackage/LoginScreen";

class PageHandle extends Component {
    constructor(props) {
        super(props)
        this.state = {
            currentUser: null
        }
    }
    render () {
        return (
            <HashRouter>
                <Redirect to="/login"/>
                <Route path="/login" component={(props) => <LoginScreen newUser={this.state.currentUser}/>} />
                <Route path="/home" component={HomePage} />
            </HashRouter>
        )
    }

}
export default PageHandle;
